import React from 'react';
import { Box, Container, Toolbar, Typography } from '@mui/material';

const Trends = () => {
  return (
    <>
      <Container
        sx={{
          background: '#39375b',
          color: 'white',
          height: '100vh',
          width: '100%',

          display: 'flex',
          // justifyContent: 'center',
          alignItems: 'center',
          flexDirection: 'column',
        }}></Container>
    </>
  );
};

export default Trends;
